import React, {Component} from 'react';
import { Col } from 'reactstrap';

class Card extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <Col className="card" sm="12" md="6" lg="4">
        <div className="card-body">
          <p className="card-title">{this.props.gitCli.title}</p>
            <code>{this.props.gitCli.usage}</code>
            <p className="card-text">{this.props.gitCli.description}</p>
            <p className="Clickbutton">{this.props.gitCli.cli}</p>
            <i class="fas fa-plus fa-4x"></i>
        </div>
      </Col>
    );
  }
}

export default Card;
